import React from 'react';
import './navBar.css'
import {MenuItems} from './menuItem.js'

function NavBar (){
        return(
            <nav className='navbarItems'>
                <h1 className='navbar-logo'>
                Expert Republic
                </h1>
                    <ul>
                        {MenuItems.NavBar .map((item, index) => {
                            return (
                                <li key={index}>
                                    <a className={item.cName} href={item.url}>
                                        {item.title}
                                        </a>
                                    </li>
                            )
                        })}

                    </ul>
            </nav>
        );
    }

export default NavBar;
